import React from "react";
import axios from "axios";
import Header from "./components/Header";

class App extends React.Component {
  state = {
    laT1: 0,
    lnG1: 0,
    zipcode: 33166,
    element: [],
    element1: []
  };

  async componentDidMount() {
    axios
      .get(
        "https://cors-anywhere.herokuapp.com/https://www.zipcodeapi.com/rest/c1wr56zxJrT9VdP63xSMddq1jzu3difJ6qcIpH87Ak8MWbBRQsfzPP3r5ISW15ET/info.json/" +
          this.state.zipcode +
          "/degrees"
      )
      .then(res => {
        console.log(JSON.stringify(res));
        this.setState({ laT1: res.data.lat, lnG1: res.data.lng });
        console.log(this.state.laT1, this.state.lnG1);
        this.secondfunc(this.state.laT1, this.state.lnG1);
      });
  }

  secondfunc = () => {
    axios
      .get(
        "https://api.betterdoctor.com/2016-03-01/practices?location=" +
          this.state.laT1 +
          "," +
          this.state.lnG1 +
          "," +
          10 +
          "&limit=2000&user_key=fb84a6a95d50d7f1b141dcc24be094dd"
      )
      .then(res => {
        this.setState({ element: res.data });
        this.thirdfunc(this.state.element);
        console.log(JSON.stringify(this.state.element));
      });
  };
  thirdfunc = () => {
    var i;
    for (i = 0; i < this.state.element.length; i++) {
      console.log(this.state.element.length);
      var newStateArray = this.state.element1.slice();
      newStateArray.push({
        lat: this.state.element[i].lat,
        long: this.state.element[i].lon,
        name: this.state.element[i].name,
        street: this.state.element[i].visit_address.street,
        city: this.state.element[i].visit_address.city,
        state: this.state.element[i].visit_address.state,
        zip: this.state.element[i].visit_address.zip,
        phone: this.state.element[i].phones[0].number
      });
    }
    this.setState({ element1: newStateArray });
    console.log(this.state.element1);
  };

  render() {
    return (
      <Header>
        laT1 ={this.state.laT1}
        lnG1 ={this.state.lnG1}
      </Header>
    );
  }
}

export default App;
